import React from "react";
import { BsCurrencyDollar, BsCart } from "react-icons/bs";
import { RiArrowDropDownLine } from "react-icons/ri";
import {
  TopHeading,
  Items,
  Logo,
  Menu,
  SingleIcon,
  DropDownContent,
  DropItem,
} from "../../styles/topNav";

class TopNav extends React.Component {
  constructor(props: any) {
    super(props);
    this.state = {
      dropdown: true,
    };
  }

  render() {
    return (
      <>
        <TopHeading>
          <Menu>
            <Items>WOMEN</Items>
            <Items>MEN</Items>
            <Items>KIDS</Items>
          </Menu>

          <Logo>Logo</Logo>

          <div>
            <SingleIcon data-badge="2">
              <BsCart />
            </SingleIcon>

            <SingleIcon>
              <BsCurrencyDollar />
              <RiArrowDropDownLine style={{ cursor: "pointer" }} />
              <input>
                <DropDownContent>
                  <DropItem> $ USD </DropItem>
                  <DropItem>&#8364; EUR </DropItem>
                  <DropItem>&#165; JPY</DropItem>
                </DropDownContent>
              </input>
            </SingleIcon>
          </div>
        </TopHeading>
      </>
    );
  }
}

export default TopNav;
